('node', 'page', 0, 6, 6, 'und', 0, '<div id="layout-main" class="group">\r\n        <div id="layout-content" class="group">\r\n                                        <div id="content" class="group">\r\n                    <div class="zone zone-content">\r\n<article class="page content-item">\r\n\r\n    \r\n<div class="orchard-layouts-root">\r\n    \r\n\r\n<div class="table">\r\n\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p style="text-align: left;"><img width="329" height="105" alt="" src="https://dotneststatic.com:443/media/gruneantwort/picture/logo.png"></p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p>Cégünk az energetika területén, új innovatív megoldások segítségével, a leghatékonyabb energiafelhasználás elérésének biztosításával foglalkozik. Alapításakor cégünk fő célkitűzése az volt, hogy a napjainkban egyre népszerűbb első sorban megújuló energiafelhasználáson alapuló rendszerek sok esetben nem megfelelő hatékonyságát az optimális keretek közé tudjuk szorítani, megtakarításokat eszközölve ezzel a fogyasztók számára.</p>\r\n<p></p>\r\n<p></p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p>A jelenleg beépítésre kerülő technológiák nem, vagy csak igen korlátozott mértékben, valamint nagy megkötések mellett teszik lehetővé a teljes rendszer (a rendszer összes elemére kiterjedő) valós idejű, folyamatos megfigyelését. Ennek hiányában azonban a rendszer hatékony működésének szempontjából rendkívül fontos információk vesznek el, melyek befolyással bírnak a hatékonyságra és ezáltal a felhasznált energia mennyiségére.</p>\r\n<p></p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p>A <b>Grüne Antwort </b>Kft. fő célkitűzése olyan innovatív rendszerek fejlesztése és üzemeltetése, mely képes a lakossági szintű felhasználóktól az ipari méretű nagyfogyasztókig szegmens- vagy teljes rendszer szinten folyamatos energetikai és fogyasztási méréseket végezni és azon adatokból a felhasználó számára legoptimálisabb adatokat szolgáltatni, mindezt a felhasználóra teljes mértékig specifikált környezetben.</p>\r\n<p>Bízunk abban, hogy szolgáltatásaink és termékeink felkeltik érdeklődésüket. Forduljanak hozzánk bizalommal!</p></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</div>\r\n</article></div>\r\n                </div>\r\n                    </div>\r\n    </div>', '', 'full_html'),
('node', 'blog', 0, 7, 7, 'und', 0, '<div id="layout-main" class="group">\r\n        <div id="layout-content" class="group">\r\n                                        <div id="content" class="group">\r\n                    <div class="zone zone-content">\r\n    <h1>Nissan Leaf</h1>\r\n<p><span>A </span><b>Nissan Leaf</b><span> </span><a href="https://hu.wikipedia.org/wiki/Elektromos_aut%C3%B3" title="Elektromos autó">elektromos meghajtású</a><span>, </span><a href="https://hu.wikipedia.org/wiki/Ferde_h%C3%A1t%C3%BA_(aut%C3%B3)" title="Ferde hátú (autó)">ferde hátú</a><span>, ötajtós autó, amit a </span><a href="https://hu.wikipedia.org/wiki/Nissan" title="Nissan">Nissan</a><span> autógyár fejlesztett ki és bocsátott piacra 2010-ben. A Leaf az első, nagy tételben eladott, tisztán elektromos meghajtású autó.</span></p>\r\n<p><span></span></p>\r\n<p><img src="https://scontent-vie1-1.xx.fbcdn.net/hphotos-xat1/v/t1.0-0/p180x540/12241671_912988212119286_6597770788602012296_n.jpg?oh=44027db3e5e44cc8be001183b2e29903&amp;oe=56EFF1C9" width="219" height="164">&nbsp;<img src="http://www.extremetech.com/wp-content/uploads/2012/01/Nissan_Leaf.jpg" width="245" height="163"></p>\r\n</article>\r\n', '', 'full_html');
INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 3, 3, 'und', 0, '<div id="layout-main" class="group">\r\n        <div id="layout-content" class="group">\r\n                                        <div id="content" class="group">\r\n                    <div class="zone zone-content">\r\n<article class="page content-item">\r\n    \r\n<div class="orchard-layouts-root">\r\n    \r\n\r\n<div class="table">\r\n\r\n<div class="row">\r\n\r\n<div class=" span-6 cell">\r\n\r\n<div><h1><span>Épületenergetikai monitoring</span></h1>\r\n<p>Napjainkban egyre nagyobb teret hódít a megújuló energia. Számtalan lehetőség kínálkozik a lakosságnak, hogy kisebb-nagyobb mértékben fejlessze ingatlanát megújuló energiát hasznosító gépészeti rendszerekkel. Az elmúlt években nagy számban építettek be ilyen rendszereket meglévő és újonnan épülő ingatlanokba. Ez a beépítési tendencia egyre inkább nő hazánk területén is mind a lakossági- mind az üzleti ingatlanok területén.</p>\r\n<p>Gyakran találkozunk ma egy családi háznál komplex rendszerrel, mely napenergiát és földhőt is hasznosít. Általában ezek a rendszerek a felhasználó szemszögéből teljesen kielégítően működnek, ám valójában sok esetben rengeteg tartalékot tartalmaznak pontos, szakszerű, szabványt követő tervezés és kivitelezés után is. Ennek oka földhőt hasznosító rendszerek esetén a nagyon változékony altalajviszonyok illetve napenergiát hasznosító rendszerek esetén az elhelyezkedési valamint épületfekvési viszonyok. Mindezek mellett igen jelentős szerepet játszik a folyamatos éghajlatváltozás, mely elég nagy szélsőségek között ingadozó meterológiai viszonyokat eredményez.</p>\r\n<p></p></div>\r\n</div>\r\n<div class=" span-6 cell">\r\n\r\n<img alt="" class="layout-content-image" src="https://dotneststatic.com:443/media/gruneantwort/picture/natural-gas-diagram.jpg">\r\n\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p>Ahhoz, hogy a megújuló energiát hasznosító épületek energiafelhasználását, esetleg a rendszerben rejlő tartalékkapacitást felfedezhessük, ezután optimalizálhassuk az ingatlanokat energihasznosítás szemponjából, folyamatos méréseket kell végeznünk. Technológiáink és szolgáltatásaink főként ebben kínálnak átfogó, komplex iránymutató és megoldási lehetőségeket.</p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><h1>Technológiai, ipari monitoring</h1>\r\n<p>Az üzemek részéről számos törekvés irányul a gazdaságosabb, hatékonyabb működés felé. Az energiaforrások használatának fegyelmezettebb módja az első lépés lehet ebbe az irányba. Azonban fajlagosan nagy energiamegtakarítást csak kevés esetben lehet a "kapcsold le a lámpát" módszerrel elérni.</p>\r\n<p>Számos kutatási projekt teljesen új szemszögből közelíti meg a megtakarítás fogalmát. A lényege abban rejlik, hogy nem feltétlenül kell munka közben kevesebb energiát használni, főleg ha ez már a kényelem kárára, ami pedig a hatékony munkavégzés kárára megy. Sokkal inkább az energiafelhasználás napi, heti elosztása a lényeg. Ahhoz, hogy ne csak egy fogyasztott mennyiséget ismerjünk vízből, elektromos áramból, hőenergiából, hanem azok napon és héten belüli eloszlását is folyamatos mérésre van szükség. Egy üzem fogyasztóponjainak folyamatos mérésével olyan adatokhoz juthatunk bizonyos idő elteltével, amellyel a működés illetve a későbbi bővítés költsége optimalizálható, csökkenthető.</p>\r\n<p>Valós és nem feltételezett fogyasztási intenzitáson alapuló rendszerek bővítése és üzemeltetése esetén jelentős összegeket takaríthatunk meg. Elképzelhető, hogy egy üzemről kiderül, nem 6 óra alatt használja el a tervezett és vízóráról leolvasott (részben mért) vízmennyiséget hanem egy folyamatos mérés alapján kiderül, hogy igazából csak 8 óra alatt fogyasztja el ugyanazt a mennyiségű vizet. Ezen adat ismeretében például a későbbi bővítés esetén elképzelhető, hogy nem szükséges, vagy nem oly mértékben szükséges a vízhálózat bővítése, hiszen lehet, hogy a korábban tervezett üzem az eredetileg tervezett vízmennyiséget jobban elosztva használja fel. Ekkor előfordulhat, hogy akár egy 30%-os üzembővítés esetén sem lesz szükséges a kiszolgáló vízhálózat bővítése.</p>\r\n<p>Cégünk ezen feladatok megoldásaira kínál egyedileg fejlesztett valamint a megrendelő igényeire optimalizált rendszerek kiépítését és támogatását.</p>\r\n<p><span class="szoveg"></span></p></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</div>\r\n</article></div>\r\n                </div>\r\n                    </div>\r\n    </div>', '', 'full_html'),
('node', 'page', 0, 4, 4, 'und', 0, '<div id="layout-main" class="group">\r\n        <div id="layout-content" class="group">\r\n                                        <div id="content" class="group">\r\n                    <div class="zone zone-content">\r\n<article class="page content-item">\r\n    \r\n<div class="orchard-layouts-root">\r\n    \r\n\r\n<div class="table">\r\n\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><h2><span>Cégadatok</span></h2>\r\n<p style="padding-left: 30px;"><b>G r ü n e&nbsp;&nbsp;&nbsp;A n t w o r t</b> Kereskedelmi és Szolgáltató Kft.</p>\r\n<p style="padding-left: 30px;">H-1114 Budapest, Bocskai út 16.</p>\r\n<p style="padding-left: 30px;">Asz.: 24105491-2-43</p>\r\n<p style="padding-left: 30px;">Cg.: 01-09-990690</p>\r\n<p style="padding-left: 30px;">Bank: 10918001-00000020-09700000</p>\r\n<p style="padding-left: 30px;"><b>i n f o</b>@gruneantwort.com</p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><h2><span>Elérhetőségek</span></h2>\r\n<p style="padding-left: 30px;"><b>Árkossy</b> Máté</p>\r\n<p style="padding-left: 30px;">ügyvezető</p>\r\n<p style="padding-left: 30px;"><b>a r k o s s y</b>@gruneantwort.com</p>\r\n<p style="padding-left: 30px;"><span class="szoveg">0036 70 625 8953</span></p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><h2><span>Technikai támogatás</span></h2>\r\n<p style="padding-left: 30px;"><b>s u p p o r t</b>@gruneantwort.com</p></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</div>\r\n</article></div>\r\n                </div>\r\n                    </div>\r\n    </div>', '', 'full_html'),
