('node', 'page', 0, 6, 6, 'und', 0, '<div id="layout-main" class="group">\r\n        <div id="layout-content" class="group">\r\n                                        <div id="content" class="group">\r\n                    <div class="zone zone-content">\r\n<article class="page content-item">\r\n\r\n    \r\n<div class="orchard-layouts-root">\r\n    \r\n\r\n<div class="table">\r\n\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p style="text-align: left;"><img width="329" height="105" alt="" src="https://dotneststatic.com:443/media/gruneantwort/picture/logo.png"></p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p>Cégünk az energetika területén, új innovatív megoldások segítségével, a leghatékonyabb energiafelhasználás elérésének biztosításával foglalkozik. Alapításakor cégünk fő célkitűzése az volt, hogy a napjainkban egyre népszerűbb első sorban megújuló energiafelhasználáson alapuló rendszerek sok esetben nem megfelelő hatékonyságát az optimális keretek közé tudjuk szorítani, megtakarításokat eszközölve ezzel a fogyasztók számára.</p>\r\n<p></p>\r\n<p></p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p>A jelenleg beépítésre kerülő technológiák nem, vagy csak igen korlátozott mértékben, valamint nagy megkötések mellett teszik lehetővé a teljes rendszer (a rendszer összes elemére kiterjedő) valós idejű, folyamatos megfigyelését. Ennek hiányában azonban a rendszer hatékony működésének szempontjából rendkívül fontos információk vesznek el, melyek befolyással bírnak a hatékonyságra és ezáltal a felhasznált energia mennyiségére.</p>\r\n<p></p></div>\r\n</div>\r\n</div>\r\n<div class="row">\r\n\r\n<div class=" span-12 cell">\r\n\r\n<div><p>A <b>Grüne Antwort </b>Kft. fő célkitűzése olyan innovatív rendszerek fejlesztése és üzemeltetése, mely képes a lakossági szintű felhasználóktól az ipari méretű nagyfogyasztókig szegmens- vagy teljes rendszer szinten folyamatos energetikai és fogyasztási méréseket végezni és azon adatokból a felhasználó számára legoptimálisabb adatokat szolgáltatni, mindezt a felhasználóra teljes mértékig specifikált környezetben.</p>\r\n<p>Bízunk abban, hogy szolgáltatásaink és termékeink felkeltik érdeklődésüket. Forduljanak hozzánk bizalommal!</p></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</div>\r\n</article></div>\r\n                </div>\r\n                    </div>\r\n    </div>', '', 'full_html'),
('node', 'blog', 0, 7, 7, 'und', 0, '<div id="layout-main" class="group">\r\n        <div id="layout-content" class="group">\r\n                                        <div id="content" class="group">\r\n                    <div class="zone zone-content">\r\n    <h1>Nissan Leaf</h1>\r\n<p><span>A </span><b>Nissan Leaf</b><span> </span><a href="https://hu.wikipedia.org/wiki/Elektromos_aut%C3%B3" title="Elektromos autó">elektromos meghajtású</a><span>, </span><a href="https://hu.wikipedia.org/wiki/Ferde_h%C3%A1t%C3%BA_(aut%C3%B3)" title="Ferde hátú (autó)">ferde hátú</a><span>, ötajtós autó, amit a </span><a href="https://hu.wikipedia.org/wiki/Nissan" title="Nissan">Nissan</a><span> autógyár fejlesztett ki és bocsátott piacra 2010-ben. A Leaf az első, nagy tételben eladott, tisztán elektromos meghajtású autó.</span></p>\r\n<p><span></span></p>\r\n<p><img src="https://scontent-vie1-1.xx.fbcdn.net/hphotos-xat1/v/t1.0-0/p180x540/12241671_912988212119286_6597770788602012296_n.jpg?oh=44027db3e5e44cc8be001183b2e29903&amp;oe=56EFF1C9" width="219" height="164">&nbsp;<img src="http://www.extremetech.com/wp-content/uploads/2012/01/Nissan_Leaf.jpg" width="245" height="163"></p>\r\n</article>\r\n', '', 'full_html');
