('management', 'Management', 'The <em>Management</em> menu contains links for administrative tasks.', 'und', 0),
('navigation', 'Navigation', 'The <em>Navigation</em> menu contains links intended for site visitors. Links are added to the <em>Navigation</em> menu automatically by some modules.', 'und', 0),
('user-menu', 'User menu', 'The <em>User</em> menu contains links related to the user''s account, as well as the ''Log out'' link.', 'und', 0);
