(3, 'node', ' szolgáltatásaink english szolgáltatásaink épületenergetikai monitoring napjainkban egyre nagyobb teret hódít a megújuló energia számtalan lehetőség kínálkozik a lakosságnak hogy kisebbnagyobb mértékben fejlessze ingatlanát megújuló energiát hasznosító gépészeti rendszerekkel az elmúlt években nagy számban építettek be ilyen rendszereket meglévő és újonnan épülő ingatlanokba ez a beépítési tendencia egyre inkább nő hazánk területén is mind a lakossági mind az üzleti ingatlanok területén gyakran találkozunk ma egy családi háznál komplex rendszerrel mely napenergiát és földhőt is hasznosít általában ezek a rendszerek a felhasználó szemszögéből teljesen kielégítően működnek ám valójában sok esetben rengeteg tartalékot tartalmaznak pontos szakszerű szabványt követő tervezés és kivitelezés után is ennek oka földhőt hasznosító rendszerek esetén a nagyon változékony altalajviszonyok illetve napenergiát hasznosító rendszerek esetén az elhelyezkedési valamint épületfekvési viszonyok mindezek mellett igen jelentős szerepet játszik a folyamatos éghajlatváltozás mely elég nagy szélsőségek között ingadozó meterológiai viszonyokat eredményez ahhoz hogy a megújuló energiát hasznosító épületek energiafelhasználását esetleg a rendszerben rejlő tartalékkapacitást felfedezhessük ezután optimalizálhassuk az ingatlanokat energihasznosítás szemponjából folyamatos méréseket kell végeznünk technológiáink és szolgáltatásaink főként ebben kínálnak átfogó komplex iránymutató és megoldási lehetőségeket technológiai ipari monitoring az üzemek részéről számos törekvés irányul a gazdaságosabb hatékonyabb működés felé az energiaforrások használatának fegyelmezettebb módja az első lépés lehet ebbe az irányba azonban fajlagosan nagy energiamegtakarítást csak kevés esetben lehet a kapcsold le a lámpát módszerrel elérni számos kutatási projekt teljesen új szemszögből közelíti meg a megtakarítás fogalmát a lényege abban rejlik hogy nem feltétlenül kell munka közben kevesebb energiát haszná